import Header from './DeliveryHeader';
import Footer from './DeliveryFooter';

class DeliveryPaotui extends Component {
  render() {
    return (
      <>
        <Header/>
        <div>
          <h2>外卖Paotui</h2>
        </div>
        <Footer/>
      </>
    );
  }
}

